<?php

namespace App\Http\Controllers;

use Illuminate\Http\Request;
use Illuminate\Support\Facades\DB;
use Barryvdh\DomPDF\Facade\Pdf as PDF;

class GraficasControlador extends Controller
{
    public function piechart(){

        $result = DB::select(DB::raw("select count(class_id) as citizen_count,citizen_classes.name from assign_citizens LEFT JOIN citizen_classes ON assign_citizens.class_id = citizen_classes.id GROUP BY citizen_classes.id"));

        $data="";
        foreach ($result as $val){
            $data.="['".$val->name."',     ".$val->citizen_count."],";
        }
        $chartData = $data;

        return view('backend.graphs.pie_chart',compact('chartData'));
    }

    public function CitizenGraphOne(){
        $googleChartImageUrl = 'data:image/png;base64,';
        $pdf = PDF::loadView('backend.graphs.citizen_graph_classes',compact('googleChartImageUrl'));
        return $pdf->download('Reporte_Tarifa_Ciudadano.pdf');

    }

    public function CitizensGraphsView(){
        $result = DB::select(DB::raw("select count(class_id) as citizen_count,citizen_classes.name from assign_citizens LEFT JOIN citizen_classes ON assign_citizens.class_id = citizen_classes.id GROUP BY citizen_classes.id"));

        $result_year = DB::select(DB::raw("select count(year_id) as citizen_count,citizen_years.name from assign_citizens LEFT JOIN citizen_years ON assign_citizens.year_id = citizen_years.id GROUP BY citizen_years.id"));


        $data="";
        foreach ($result as $val){
            $data.="['".$val->name."',     ".$val->citizen_count."],";
        }

        $data_year="";
        foreach ($result_year as $val_year){
            $data_year.="['".$val_year->name."',     ".$val_year->citizen_count."],";
        }



        $chartData = $data;
        $chartYear = $data_year;

        return view('backend.report.citizen_graphs.graphs',compact('chartData','chartYear'));
    }

    public function CitizensGraphsClass(){
        $googleChartImageUrl = 'data:image/png;base64,';
        $pdf = PDF::loadView('backend.graphs.class_citizens',compact('googleChartImageUrl'));
        return $pdf->download('Grafica_Clase_Ciudadanos.pdf');
    }

    public function CitizensGraphsYear(){
        $googleChartImageUrl = 'data:image/png;base64,';
        $pdf = PDF::loadView('backend.graphs.year_citizens',compact('googleChartImageUrl'));
        return $pdf->download('Grafica_Anio_Ciudadanos.pdf');
    }
}
